import React from "react";

export default function PlayerList({ players }) {
  return (
    <div>
      <h3>Players</h3>
      <ul>
        {players.map((p) => (
          <li key={p.id}>
            {p.name} {p.isHost && "(Host)"} {p.isWordSetter && "(Word Setter)"} - {p.score} pts
          </li>
        ))}
      </ul>
    </div>
  );
}
